(42947, '1811AFE7-878B-4F7F-B315-5A6DB3C47785', 'Love, I got scared by your “close call” this weekend. I’m really relieved that you you mostly shook it off…and that nothing worse happened. Two feelings: my anxious problem-solver wants us both to improve in our skiing abilities….it’s good to be testing our limits in our active lifestyle choices, but we both can lower our risk by just being better and safer….I say this for both of us, because I too felt on edge yesterday a few times and didn’t feel in control as much as I would have liked. Second feeling: I love you so deeply that the thought of you smashing your head and having something happen completely freaks me out! I want many more wonderful weekends together. Was so awesome….and let’s not have the next one in the emergency room!', 'David', 'Nitzan', '2022-02-07T12:09:53.761000'),
