(43077, 'E5252F9D-1D64-44EC-849A-9139351ADEA9', 'Thinking of you love and us venturing out tonight. I️ appreciate you in so so many ways. It means a lot that you’ve redefined how we approach non monogamy. And it means even more than you’ve worked to redefine your relationship with Ilsa so that it doesn’t feel like a threat. It’s felt SOoooooo much better this time around and I️ am so grateful to have you as a partner who engages in the nuances and tries to figure out how to make a super unconventional dynamic work. You mean more to me than anything in the world and I️‘m excited for both of us to have fun nights. And then to be reunited for our own snuggling and loving.  You are the hottest and sexiest. And you are my pair body. And I️ want you to have a great time tonight. Love you lots!', 'Nitzan', 'David', '2022-02-09T17:12:26.803368'),
(43078, 'C0EA6D08-8EB3-47FD-A718-F7825F6B413F', 'Dear Love, You beat me to it! Thank you for the acknowledgment and encouragement. You are the hottest and sexiest hands down. Call no I have not been easy lately yet I feel we have made tremendous progress l. I feel listened to and loved it and it makes me feel grounded and secure. I hope we have now got to a stage in the learning curve where the truly hard stuff is behind us and while I know there will still be more hard stuff I have experienced our resilience. I am excited for you to just enjoy yourself and weirdly maybe the thought of you getting turned on by another man actually kind of turns me on too. Who knows how long that will last? :-). So have fun. I love you to pieces and I look forward to reconnecting when we are both home this evening. I’ll text you when I’m on my way. And as we agreed will shoot for 11 PM. I love you!', 'David', 'Nitzan', '2022-02-09T17:40:51.767749'),
